    getFancyBook(fancy) {
      this.fancyBookData = [];
      this.userService.getFancyBook(fancy.mid, fancy.sid, fancy.nat).subscribe(books => {
        if (books.result.length == 0) {
          return;
        }

        let matrix = Object.values(books.result[0])[0].replace(/\{|\}/g, '').split(',').map(f => {
          return f.split(':').map(b => b = +b);
        }); // console.log(matrix)

        for (let i = 0; i < matrix.length; i++) {
          let run = matrix[i][0];
          let row = [];

          if (i === 0) {
            row[0] = run + ' and below';
          } else if (i === matrix.length - 1) {
            row[0] = matrix[i - 1][0] + 1 + ' and above';
          } else if (matrix[i - 1][0] + 1 === matrix[i][0]) {
            row[0] = matrix[i][0];
          } else {
            row[0] = matrix[i - 1][0] + 1 + '-' + matrix[i][0];
          }

          row[1] = matrix[i][1];
          this.fancyBookData.push(row);
        }

        $('#fancyBetBookLeftSide').css("display", "flex");
        $('#sideWrap').addClass("left-in");
        setTimeout(() => {
          $('#sideWrap').removeClass("left-in");
        }, 1000);
        console.log(this.fancyBookData);
      });
    }

