    scrollToElement(f, g) {
      if (f.length == 0) {
        return;
      }

      var c = g.offset().top;
      var h = f.offset().top;
      var d = $("body").scrollTop();

      if (this.orientation == 180 || this.orientation == 0) {
        $("html, body").animate({
          scrollTop: h - c
        }, "fast");
      } else {
        if (this.orientation == 90 || this.orientation == -90) {
          $("html, body").animate({
            scrollTop: h + d
          }, "fast");
        }
      }
    }

